import ProjectInforItem from './ProjectInforItem'
import SectionTitle from './SectionTitle'
export default function ProjectSection() {
  return (
    <div className='project_container'>
        <SectionTitle heading="Experiencess" subheading="Some of my work"/>
        
        <div className='project_item'>
          <ProjectInforItem />
        </div>
        

    </div>
  )
}
